import Header from './components/header';
import Navbar from './components/Navbar';
import AboutMe from './components/AboutMe';
import Skills from './components/Skills';
import Projects from './components/Projects';
import movieFinderPreview  from './assets/Alabaster-Alligator_sc.png'
import './style.css';

const projects = [
  {
    name: "Movie Finder",
    link: "https://eschase4.github.io/Alabaster-Alligators_sc.png/",
    preview: movieFinderPreview,
    description: "My first bootcamp project. It allows users to take a quiz about the mood that they are in, and recommends a movie based on the results"
  }
]

function App() {
  return (
    <>
      <Header />
      <Navbar />
      <div id="appContent">
        <AboutMe />
        <Skills />
      </div>
      <Projects projectName={projects.name} projectLink={projects.link} projectPreview={projects.preview} />
    </>
  );
}

export default App;
